// src/router/index.js
import { createRouter, createWebHistory } from 'vue-router';
import Misiones from '../views/Misiones.vue';
import Equipos from '../views/Equipos.vue';

const routes = [
  {
    path: '/misiones',
    name: 'Misiones',
    component: Misiones,
  },
  {
    path: '/equipos',
    name: 'Equipos',
    component: Equipos,
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
